import * as React from 'react';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import { borderColor } from '@mui/system';

export default function ImgMediaCard(props) {
  return (
      <div> 
    <Card sx={{ maxWidth: 250 , padding : '30px', margin : '10px', border : 'solid' ,borderColor : 'black'}} >
      <CardMedia
        component="img"
        alt="green iguana"
        height="220"
        image={props.image}
      />
      <CardContent>
        <Typography align="center" gutterBottom variant='subtitle1' component="div">
          {props.title}
        </Typography>
      </CardContent>
      <CardActions>
        <Button variant="contained" size= 'small' color='error'>WATCH NOW</Button>
        <Button variant='outlined' size="small">ADD TO WISHLIST</Button>
      </CardActions>
    </Card>
    </div>
  );
}
